description:
No Man's Land Asian Edition 3

Starring:  Fujiko Kano, Jade Marcela, Mia Smiles, Kitty Yung aka Tia Son, Envy Mi, Bamboo, Cheryl Dynasty, Kianna Dior 

Distributor:  Video Team
Director:  Wes Emerson

A wealthy arts patron employs a resourceful &quot;acquisitions expert&quot; to procure a rare Japanese translation of erotic lesbian poetry from Ancient Greece. What ensues for the thieving expert is a kinky foray into the &quot;Velvet Mafia,&quot; L.A.'s hidden underground of well-heeled, well-monied women who love women.

